const initState = {
    inputValue: 'jspang',
    list: ['我有一头小毛驴，我从来也不骑']
};
export default (state=initState, action) =>{
    if(action.type === 'change_input'){
        let newState = JSON.parse(JSON.stringify(state));
    }
    return state;
}
